title: Mutual recursion in a chain of inheritance
description: >
  The defect manifests in the form of call chain cycles.
  The following cycles are present here:
  o8482.o8485.o8486.m1 -> o8507.m2 -> o8482.o8485.o8486.m1
  o8507.m2 -> o8482.o8485.o8486.m1 -> o8507.m2

features:
  - inheritance
  - overriding
  - method
  - polymorphism

